import React from 'react';
import ReactDOM from 'react-dom';
import add,{sub,mult,divide} from './Calculate';


ReactDOM.render(
    <>
      <h1>{`The sum of no. is - ${add(10,5)}`}</h1>
      <h1>{`The difference of no. is - ${sub(10,5)}`}</h1>
      <h1>{`The product of no. is - ${mult(10,5)}`}</h1>
      <h1>{`The division of no. is - ${divide(10,5)}`}</h1>
    </>,
    document.getElementById("root")
);
